css:
@-moz-document domain("momio.me") {
    .landingpage {
        background: url(https://i.ibb.co/3W8w5RG/momio-hd-4k-old-screen.png) center top no-repeat #e5f1fd;
        background-size: cover;
    }

    .landingpage-btnsContainer {
        margin-top: 90px;
    }

    .btn-purple {
        background-color: #ab38ff;
        background-image: linear-gradient(180deg,#a728f0 0%,#9925e0 100%);
        color: #fff;
        text-shadow: 0 1px 0 rgba(0,0,0,.2);
    }

    .btn-purple:hover {
        background-color: #9925e0;
        background-image: none;
    }

    .btn-purple:active {
        background-color: #7e1bbf;
        background-image: none;
    }

    .btn-purple:visited {
        color: #fff;
    }

    .btn-purple .icon {
        background-image: url(https://i.ibb.co/TBF05cL/momio-cloud.png);
        background-repeat: no-repeat;
        background-position: center;
    }

    .btn-light-blue {
        background-color: #68d6fc;
        background-image: linear-gradient(180deg,#5bc7f7 0%,#55c3f3 100%);
        color: #fff;
        text-shadow: 0 1px 0 rgba(0,0,0,.2);
    }

    .btn-light-blue:hover {
        background-color: #55c3f3;
        background-image: none;
    }

    .btn-light-blue:active {
        background-color: #47b2e1;
        background-image: none;
    }

    .btn-light-blue:visited {
        color: #fff;
    }

    .btn-light-blue .icon {
        background-image: url(https://i.ibb.co/VLzLyFx/momio-cloud-white.png);
        background-repeat: no-repeat;
        background-position: center;
    }

    .momio-buttons .btn {
        font-family: "Porkys", cursive !important;
        font-size: 20px !important;
        font-weight: bold !important;
        padding: 14px 30px !important;
        border-radius: 30px !important;
        text-shadow: 0 1px 0 rgba(0,0,0,.2) !important;
    }

    .momio-buttons .btn:hover {
        text-decoration: none !important;
    }

    .momio-buttons {
        text-align: center;
    }

    .momio-buttons .btn + .btn {
        margin-left: 20px;
    }
}
